package cmd

import (
	"bytes"
	"crypto/tls"
	"encoding/base64"
	"encoding/json"
	"io/ioutil"
	"log"
	"net/http"
)

var client *http.Client

func TorchClientInit() {

	tr := &http.Transport{
		TLSClientConfig: &tls.Config{InsecureSkipVerify: true},
	}

	client = &http.Client{Transport: tr}
}


//https://10.2.3.62:8080/predictions/reID_batch
func postImgs(imgsBase64json []byte) (string, error) {
	resp, err := client.Post(
		"https://10.2.3.62:8080/predictions/reID_batch",
		"application/text",
		bytes.NewBuffer(imgsBase64json))

	if err != nil {
		log.Print(err)
		return "", err
	}

	body, _ := ioutil.ReadAll(resp.Body)
	resp.Body.Close()	//一定要Close 否则会造成内存泄漏!

	log.Printf("request %d byte json result: %s\n", len(body), string(body))
	return string(body), nil
}

